local GVIWwEpZ = ""
local MixHphoO = "sBXSLWqfnjSk"

local function SxytLkyd_b64(data)
    local b = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/'
    data = string.gsub(data, '[^'..b..'=]', '')
    return (data:gsub('.', function(x)
        if (x == '=') then return '' end
        local r,f='',(b:find(x)-1)
        for i=6,1,-1 do r=r..(f%2^i-f%2^(i-1)>0 and '1' or '0') end
        return r;
    end):gsub('%d%d%d?%d?%d?%d?%d?%d?', function(x)
        if (#x ~= 8) then return '' end
        local c=0
        for i=1,8 do c=c+(x:sub(i,i)=='1' and 2^(8-i) or 0) end
        return string.char(c)
    end))
end

local function SxytLkyd(str, key)
    local res = {}
    
    local decoded = nil
    if crypt and crypt.base64decode then 
        decoded = crypt.base64decode(str)
    elseif base64decode then 
        decoded = base64decode(str)
    else
        decoded = SxytLkyd_b64(str)
    end
    
    if not decoded then return nil end

    for i = 1, #decoded do
        local b = string.byte(decoded, i, i)
        local k = string.byte(key, (i - 1) % #key + 1, (i - 1) % #key + 1)
        if bit32 then
            table.insert(res, string.char(bit32.bxor(b, k)))
        else
            local xor = b - k
            if xor < 0 then xor = xor + 256 end
            pcall(function() 
                table.insert(res, string.char(bit32.bxor(b, k))) 
            end)
        end
    end
    return table.concat(res)
end

local dec_source = SxytLkyd(GVIWwEpZ, MixHphoO)
local UHfgyVCR, err = loadstring(dec_source)

if not UHfgyVCR then
    warn("Matcha Loader Error: " .. tostring(err))
    print("Failed Source (Partial):", string.sub(dec_source, 1, 100))
else
    UHfgyVCR()
end
